// JQLLexerInit initializes any static state used to implement JQLLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewJQLLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func JQLLexerInit() {
	staticData := &jqllexerLexerStaticData
	staticData.once.Do(jqllexerLexerInit)
}

// NewJQLLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewJQLLexer(input antlr.CharStream) *JQLLexer {
	JQLLexerInit()
	l := new(JQLLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &jqllexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.predictionContextCache)
	l.channelNames = staticData.channelNames
	l.modeNames = staticData.modeNames
	l.RuleNames = staticData.ruleNames
	l.LiteralNames = staticData.literalNames
	l.SymbolicNames = staticData.symbolicNames
	l.GrammarFileName = "JQLLexer.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

